            if (this.error) {
                this.errorMessage = "Video not uploaded. Please try again";
            }
            else {
                this.errorMessage = 'Some thing wrong.Please try again';
            }
            this.commonService.presentAlert("Error", this.errorMessage, ["Ok"], '');
